import React from "react";
import { Link } from "react-router-dom";
import Userdata from "./Userdata";
function Users() {
  return (
    <div>
      <h1>Users</h1>
      {Userdata.map((eachUser) => {
        const { id, name, email } = eachUser;
        return (
          <Link>
            <article key={id}>
              <h3>{name}</h3>
              <h5>{email}</h5>
            </article>
          </Link>
        );
      })}
    </div>
  );
}
export default Users;
